import React from "react";
import Icon1 from "../../images/svg-1.png";
import {
  TeamMemberCard as TeamMemberCard,
  TeamContainer,
  TeamH1,
  TeamH2,
  TeamIcon,
  TeamP,
  TeamWrapper,
  ImgWrap,
  Img,
} from "./TeamElements";

export const Team = () => {
  return (
    <TeamContainer id="team">
      <TeamH1>Nasz sk≈Çad</TeamH1>
      <TeamWrapper>
        <TeamMemberCard>
          <ImgWrap>
            <Img src={require('../../images/monika.jpg').default}  />
          </ImgWrap>
          <TeamH2>Piotr Maestro! Klawisz, akordeon, wokal, wodzirej</TeamH2>
          <TeamP>We help reduce your fess.</TeamP>
        </TeamMemberCard>
      </TeamWrapper>
    </TeamContainer>
  );
};
